import React, { useEffect, useState } from 'react';
import style from './Planet.module.css';
import PlanetImage from './PlanetImage';

const Planet = (props) => {
  const [planetData, setPlanetData] = useState({
    residents: [],
    films: [],
  });

  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const formatTimestamp = (timestamp) => {
    const date = new Date(timestamp);
    return date.toLocaleString();
  };

  const fetchData = async () => {
    try {
      setIsLoading(true);

      const residentNames = await Promise.all(
        props.residents.map(async (residentUrl) => {
          const response = await fetch(residentUrl);
          const data = await response.json();
          return data.name;
        })
      );

      const filmTitles = await Promise.all(
        props.films.map(async (filmUrl) => {
          const response = await fetch(filmUrl);
          const data = await response.json();
          return data.title;
        })
      );

      setPlanetData({
        residents: residentNames,
        films: filmTitles,
      });

      setIsLoading(false);
    } catch (error) {
      setError(error.message);
      setIsLoading(false);
    }
  };

  useEffect(() => {
    // Fetch data when the component mounts
    fetchData();
  }, [props.residents, props.films]);

  const handleResidentsClick = () => {
    // Fetch resident data only when clicked
    if (planetData.residents.length === 0) {
      fetchData();
    }
  };

  const handleFilmsClick = () => {
    // Fetch film data only when clicked
    if (planetData.films.length === 0) {
      fetchData();
    }
  };

  // Define planetDescription here (you can fetch it from PlanetImage)
  const planetDescription = PlanetImage.find((planet) => planet.name === props.id)?.description || "";

  return (
    <div className={style.planet}>
      <h4>Planet: {props.id}</h4>
      <img src={props.imageSrc} alt={props.id} />
      <div>Description: <p>{planetDescription}</p></div>
      <p>Climate: {props.climate}</p>
      <p>Terrain: {props.terrain}</p>
      <p>Population: {props.population}</p>
      <p>Diameter: {props.diameter}</p>
      <p>Gravity: {props.gravity}</p>
      <p>Rotation Period: {props.rotationPeriod}</p>
      <p>Orbital Period: {props.orbitalPeriod}</p>
      <p>Surface Water: {props.surfaceWater}</p>
      <div>
        Residents:
        {planetData.residents.length === 0 && (
          <button onClick={handleResidentsClick}>Load Residents</button>
        )}
        {planetData.residents.length > 0 && (
          <ul>
            {planetData.residents.map((resident, index) => (
              <li key={index}>{resident}</li>
            ))}
          </ul>
        )}
      </div>

      <div>
        Films:
        {planetData.films.length === 0 && (
          <button onClick={handleFilmsClick}>Load Films</button>
        )}
        {planetData.films.length > 0 && (
          <ul>
            {planetData.films.map((film, index) => (
              <li key={index}>{film}</li>
            ))}
          </ul>
        )}
      </div>
      <p>Created: {formatTimestamp(props.created)}</p>
      <p>Edited: {formatTimestamp(props.edited)}</p>
      <p>URL: {props.url}</p>
    </div>
  );
};

export default Planet;
